import React from 'react';
export default function test({ countries }) {
    return (
        <div >
            <select className='select-style'>
                {countries.map(({ Country, ISO2 }) => (
                    <option key={ISO2} value={ISO2.toLowerCase()} >
                        {Country}
                    </option>
                ))}
            </select>


            <div className="dropdown">
                <div className="dropdown-select">
                    <span class="select">Selected item</span>
                    <i class="fa fa-caret-down icon"></i>
                </div>
                <div className='dropdown-list'>
                    {countries.map(({ Country, ISO2 }) => (
                        <div key={ISO2} value={ISO2.toLowerCase()}  classNa="dropdown-list__item">
                            {Country}
                        </div>
                    ))}
                    
                </div>
            </div>
        </div>
    );

}
